import {NavLink} from "react-router-dom";

function Navbar(){
    return (
        <>
            <nav className='nav-bar'>
                <ul>
                    <li><NavLink to='/'></NavLink></li>
                </ul>
            </nav>
        </>
    );

}

export default Navbar;
